import React,{Component} from 'react'
import './App.css';
import RestaurantPhoto from './Components/Restaurant.photo';
import RestaurantStatus from './Components/Restaurant.Status';

export default class App extends Component{
  render(){
    return(
      <div id="App">
        <div>
          <RestaurantPhoto />
        </div>
        <div>
        <RestaurantStatus />
        </div>

      </div>
    )
  }
}
